import React from "react";
import {NavLink, Navbar } from "react-router-dom";
import s from "./Header.module.css";

const Header = () => {
    return (
        <div className={s.wrapper}>
    <div className={s.itemtitle}> Центр электронного обучения ИРНИТУ </div>
            <div className={s.navi}>
        <div><NavLink to="/">Главная </NavLink> </div>
        <div><NavLink to="/news" > Новости </NavLink> </div>
        <div><NavLink to="/documents"> Документы </NavLink> </div>
        <div><NavLink to="/centre"> О центре </NavLink> </div>
            </div>
    </div>)
}

export default Header;
